// ==UserScript==
// @name         HunterCourse auto-clicker
// @namespace    http://samg381.com
// @version      1.1
// @description  Userscript which automatically progresses through HunterCourse.com lessons.
// @             Single-tone chime indicates progression (no action required). Three-tone chime alerts user to quizzes (action required).
// @             For educational purposes only. The use of this tool during officially sanctioned hunting courses is not condoned.
// @author       Samg381
// @run-at       document-idle
// @match        www2.huntercourse.com/*
// @downloadURL  
// @updateURL    
// @grant        none
// @require
// @noframes

// ==/UserScript==

(function() {

    // Locate the 'Next' button on the page
    var nextButton = document.getElementById('ctl01_MainContent_courseManual_hlBottomNext');


    // Check if the 'Next' button was found and valid
    if ( nextButton ){

        // If the 'Next' button is valid, call our monitoring funciton on the button.
        var refreshIntervalId = setInterval(checkIfClikable, 500);

    }
    else {

        // A valid 'Next' button was not found.
        // Before we give up, let's check if this is actually a video intermodal page.
        // (The 'Next' buttons on these pages do not use the same ID as the buttons on the non-video pages)

        nextButton = document.getElementsByClassName("hlNext tiny button right")[0];

        if (nextButton) {

            // If the 'Next' button is valid, call our monitoring funciton on the button.
            refreshIntervalId = setInterval(checkIfClikable, 500);

        }
        else {

            // We didn't find any clickable buttons.
            // This should mean we have finished the chapter, and need to take the quiz (or final exam)

            // Play a three-tone beep to inform user the quiz is ready.
            endingBeep();

            // We are done.
            return;

        }


    }




    // This function is called on a valid 'Next' button, and continuously checks for the button to become clickable.
    function checkIfClikable() {

        if((nextButton.getAttribute('onclick')!=null)||(nextButton.getAttribute('href')!=null)){

            // The button appears to be clickable!

            // Highlight the button
            nextButton.style.background = 'Green';

            // Play a single-tone beep to alert the user of progress
            successBeep();

            // Click the button to progress to the next lesson
            nextButton.click();

            // Stop this function and prepare for next button search
            clearInterval(refreshIntervalId);
            return;

        }
        else {

            // Color the 'Next' button grey if it is not yet clickable.
            nextButton.style.background = 'Grey';

        }

    }




    // Store some beeps in base64 URI
    function successBeep() {
        var snd = new Audio("data:audio/wav;base64,");
        snd.play();
    }

    function endingBeep() {
        var snd = new Audio("data:audio/wav;base64,");
        snd.play();
    }


})();
